import {BrowserRouter as Router,Route,Routes} from"react-router-dom";
//import logo from './logo.svg';
import './App.css';
import Home from "./General/Home";
import About from "./General/About"
import Contact from "./General/Contact"
import Service from "./General/"
import Feature from "./Main/Feature"
import UserLogin from "./UserComp/UserLogin"
import Register from "./UserComp/Register"
import Dashboard from "./AdminComp/Dashboard"
import Master from "./Masters/Master"
import AddParking from "./AdminComp/AddParking";
import AddCity from "./AdminComp/AddCity";
import ViewCity from "./AdminComp/ViewCity";
import AddSlots from "./AdminComp/AddSlots";
import Manage from "./AdminComp/Manage";
import ViewBookings from "./AdminComp/ViewBooking";
import ViewUser from "./AdminComp/ViewUser";
import AMaster from "./Masters/AMaster";
import AdminLogin from "./AdminComp/AdminLogin";




function App(){
  return (
    <>
    <Router>
      <Routes>
        <Route path="/" element={<Master/>}>
        <Route path="/" element={<Home/>}/>
        <Route path="/about" element={<About/>}/>
        <Route path="/contact" element={<Contact/>}/>
        <Route path="/feature" element={<Feature/>}/>
        <Route path="/service" element={<Service/>}/>
        <Route path="/adminLogin" element={<AdminLogin/>}/>
        <Route path="/userLogin" element={<UserLogin/>}/>
        <Route path="/register" element={<Register/>}/>
        </Route>


        <Route path="/admin" element={<AMaster/>}>
        <Route path="/admin" element={<Dashboard/>}/>
        <Route path="addParking" element={<AddParking/>}/>
        <Route path="addCity" element={<AddCity/>}/>
        <Route path="viewCity" element={<ViewCity/>}/>
        <Route path="addSlots" element={<AddSlots/>}/>
        <Route path="manage" element={<Manage/>}/>
        <Route path="viewBookings" element={<ViewBookings/>}/>
        <Route path="viewUser" element={<ViewUser/>}/>

        </Route>





      </Routes>
    </Router>

    </>
  )

}



export default App;
